  false,\n\t\"url\": null,\n\t\"notes\": \"NGDC maintains a large volume of both Analog
  and Digital seismic reflection data. Currently only a limited number of lines are
  available online. Digital data include SEGY files and scanned images of the full-scale
  section as well as shot point navigation. Additional Digital seismic reflection
  data are available on request and can be searched for (along with other underway
  geophysical data) using GEODAS. Analog data are available on microfilm or as either
  paper/Mylar full-scale sections. A search for seismic reflection data using GEODAS
  will determine what data exist in a region. However, to obtain data as a result
  of this search please contact NGDC. These data were collected mainly by US Geological
  Survey and various geophysical companies.\",\n\t\"license_title\": null,\n\t\"extras\":
